import logo from './logo.svg';
import './App.scss';
import Form from './components/Form/Form';
import NavBar from './components/NavBar/NavBar';
import VideoDescription from './components/VideoDescription/VideoDescription';
import VideoList from './components/VideoList/VideoList';
import VideoPlayer from './components/VideoPlayer/VideoPlayer';
import VideoArray from './data/data';

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <NavBar />
        <VideoPlayer image={VideoArray[1].image}/>
        <VideoDescription title={VideoArray[1].title} uploader={VideoArray[1].channel} uploadDate={new Date(VideoArray[1].timestamp).toLocaleDateString()} 
        views={VideoArray[1].views} likes={VideoArray[1].likes}  description={VideoArray[1].description}/>
        <Form />
        <VideoList />
      </div>
    );
  }
}

export default App;
